import React from 'react';
import JsLogo from './JsLogo.svg';
import './Skills.css'
const Skills = (onRouteChange) => {
	return (
		<div>
			<p style={{margin: '0px', color: 'white', 'font-size': '50px'}}>SKILLS</p>
			<div className='SkillContainer'>
				<img className="JsLogo" src={JsLogo} width="200px" height="200px"/>
			</div>
		</div>

		)
};

export default Skills;
